<!DOCTYPE html>
<html lang="en">
	<head>
		<meta charset="UTF-8" />
		<title>Grafana Dashboard Report</title>
		<style>
			:root {
				--border-radius: 6px;
				--gap: 20px;
			}
			html,
			body {
				padding: 0;
				margin: 0;
				font-family: Arial, sans-serif;
			}
			* {
				padding: 0;
				margin: 0;
				box-sizing: border-box;
			}
			.screenshots-container {
				display: flex;
				flex-direction: column;
				gap: var(--gap);
				width: 100%;
				padding: var(--gap);
			}
			.screenshot-row {
				display: flex;
				gap: var(--gap);
				height: 320px;
				width: 100%;
				page-break-inside: avoid;
			}
			.screenshot {
				flex: 1 1 0px;
				border-radius: var(--border-radius);
				overflow: hidden;
			}
			.screenshot img {
				width: 100%;
				height: 100%;
				display: block;
			}

			.cover-box {
				page-break-after: always;
				width: 100%;
				height: 1030px;
				overflow: hidden;
			}

			.cover-box img {
				width: 100%;
				height: 100%;
				display: block;
			}
		</style>
	</head>
